import React from 'react';
import './Topbar2.css';
import {Chat, Person, Notifications, Search} from "@material-ui/icons";
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Topbar2(prop) {

    const [home,setHome] = useState(false);
    const [timeline, setTimeline] = useState (true);
    const navigate = useNavigate();

   const  homeHandler = () => {
        setTimeline(false);
        setHome(true);
        
    }
      

const timeLineHandler = () => {
    setHome(false);
    setTimeline(true);

}
prop.home(home);
prop.timeline(timeline);


  return (
    <div className="topbar">
        
            <div className="topleft">
            <span className="logo">SocialmediApp</span>
            </div>
            <div className="topcenter">
                <Search className="searchicon"/>
                <input placeholder="Search for friend,post and video" type="text" className="searchbar" />
            </div>
            <div className="topright">
            <div className="links">
                <span className="link" onClick={() => navigate("home")}>Homepage</span>
                <span className="link" onClick={timeLineHandler}>Timeline</span>
            </div>
            <div className="topbaricons">
                <div className="indicators">
                    <Person className='icon'/>
                    <span className="iconcounter">1</span>
                </div>
                <div className="indicators">
                    <Chat className='icon'/>
                    <span className="iconcounter">3</span>
                </div>
                <div className="indicators">
                    <Notifications className='icon'/>
                    <span className="iconcounter">4</span>
                </div>
                </div>
            <div className="profileimg">
                <img src="./Assets/tree.jpg" alt="" className="profilepic" />
            </div>
            </div>
        </div>
    
  )
}
